import React from "react";
import style from "./Nav.module.css";

const Nav = () => {
  return (
    <nav>
      <div className={style.logo}>
        <h4>Ingredients</h4>
      </div>

      <ul className={style.nav - links}>
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Work</a>
        </li>
        <li>
          <a href="#">Projects</a>
        </li>
      </ul>
    </nav>
  );
};

export default Nav;
